import React from 'react';
import OnepageMenu from '../components/OnepageMenu';
import ServicesBanner from '../components/Banner/ServicesBanner';


const ServiceTechnology = () => {
    return(
        <div className="body_wrapper">
            <OnepageMenu 
                    menu_txt1= "menu_txt1" 
                    menu_txt2= "menu_txt2" menu_txt3= "menu_txt3" 
                    menu_txt4= "menu_txt4" menu_txt5= "menu_txt5" 
                    menu_txt6= "menu_txt6" menu_logo= "menu_logo" /> 
            <ServicesBanner 
                    ClassC='service_4' 
                    Title='Technology Consulting ' 
                    TitleN='Services' 
                    TitleP='We offer innovative solutions that will revitalize your business in a modern way and with the best technology.'
                    Simage='slider-consulting.png'/>
        </div>
    )
}
export default ServiceTechnology;
